/*

Database Creation and Table Setup Script

Script Purpose:
    This script creates a new SQL Server database named 'SalesDB'. 
    If the database already exists, it is dropped to ensure a clean setup. 
    The script then creates five tables: 'customers', 'orders', 'employees', 'products', and 'orders_archives' 
    with their respective schemas, and populates them with sample data.

*/


USE master;
GO

-- Check if the database exists
IF DB_ID('EcomSales_DB') IS NOT NULL
BEGIN
    ALTER DATABASE EcomSales_DB SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
    DROP DATABASE EcomSales_DB;
END
GO

-- Create a new database
CREATE DATABASE EcomSales_DB;
GO


USE EcomSales_DB;
GO

-- Check if the schema 'Sales' exists
IF EXISTS (SELECT 1 FROM INFORMATION_SCHEMA.SCHEMATA WHERE SCHEMA_NAME = 'Sales')
BEGIN
    -- If it does exist, drop the 'Sales' schema
    DROP SCHEMA Sales;
END;
GO

-- Create the 'Sales' Schema using dynamic SQL
EXEC sys.sp_executesql N'CREATE SCHEMA Sales;';
GO


-- Table: customers


CREATE TABLE Sales.Customers (
    CustomerID INT NOT NULL,
    FirstName NVARCHAR(50),
    LastName NVARCHAR(50),
    Country NVARCHAR(50),
    Score INT,
    CONSTRAINT PK_customers PRIMARY KEY (CustomerID)
);
GO


GO


-- Table: Employee

-- Create Employee table
CREATE TABLE Sales.Employees (
    EmployeeID INT NOT NULL,
    FirstName NVARCHAR(50),
    LastName NVARCHAR(50),
    Department NVARCHAR(50),
    BirthDate DATE,
    Gender CHAR(1),
    Salary DECIMAL(10, 2),
	ManagerID INT,
	CONSTRAINT PK_employees PRIMARY KEY (EmployeeID)
);
GO

GO

-- Table: Products

-- Create Products table
CREATE TABLE Sales.Products (
    ProductID INT NOT NULL,
    Product NVARCHAR(50),
    Category NVARCHAR(50),
    price DECIMAL(10, 2),
	CONSTRAINT PK_products PRIMARY KEY (ProductID)
);
GO

GO

-- Table: orders

-- Create Orders table
CREATE TABLE Sales.Orders (
    OrderID INT NOT NULL,
	ProductID INT,
    CustomerID INT,
    SalesPersonID INT,
    OrderDate DATE,
    ShipDate DATE,
    OrderStatus NVARCHAR(50),
	ShipAddress NVARCHAR(400),
	BillAddress NVARCHAR(400),
    Quantity INT,
    Sales DECIMAL(10, 2),
	CreationTime DATETIME2,
	CONSTRAINT PK_orders PRIMARY KEY (OrderID)
);
GO





